    <>
    <Navbar/>
    <div className='back'>
      <Toolbar/>
    </div>
    <div id="background">
      <img src="assets/catogory.jpeg" id="catogory"/>  
    </div>

<div class="row">
  <div class="col-sm-3">
    
  </div>
</div>
    </>
  )
}
